import React from "react";

const ProjectsSection = () => {
  const projects = [
    {
      title: "Car wash web app",
      image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTRAQsxZOXH8XL53Wqy7mK9YsR5RdooG5IobA&s",
    },
    {
      title: "Portfolio Website",
      image: "https://mir-s3-cdn-cf.behance.net/projects/404/49f28e189617081.Y3JvcCwxMDA2LDc4NywxOTYsMA.jpg",
    },
    {
      title: "A/B Testiong Application",
      image: "data:image/jpeg;base64,",
    },
    {
      title: "Presentation website for Fouita's Widgets",
      image: "data:image/jpeg;base64,",
    },
    {
        title: "ChatBot App",
        image: "data:image/jpeg;base64,",
      },
      {
        title: "Video call website",
        image: "data:image/jpeg;base64,",
      },
      {
        title: "Real time message application",
        image: "data:image/jpeg;base64,",
      },
      {
        title: "Blogs website",
        image: "data:image/jpeg;base64,",
      },
  ];

  return (
    <section className="projects-section p-8 bg-gray-900" id="projects">
      <h2 className="text-3xl font-bold text-center text-white mb-8">Projects</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
        {projects.map((project, index) => (
          <div
            key={index}
            className="project-card bg-gray-800 rounded-lg overflow-hidden shadow-lg hover:shadow-xl transition-shadow duration-300"
          >
            <div className="relative group">
              <img
                src={project.image}
                alt={project.title}
                className="w-full h-52 object-cover transition-transform duration-300 group-hover:scale-105"
              />
              <div className="absolute inset-0 bg-black bg-opacity-50 flex items-center justify-center opacity-0 group-hover:opacity-100 transition-opacity duration-300">
                <h3 className="text-xl font-semibold text-white text-center">
                  {project.title}
                </h3>
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default ProjectsSection;
